회차 제목은 &quot;나무처럼 단단해지길&quot;
본문 속 제목은 &quot;나무처럼 우거지길&quot; 이네요
제가 취중이라 잘못본걸까요@ㅁ@

매 화마다 인생의 경구가 들어있네요. 
&quot;밸런스가 잘 맞았을 때, 파도를 즐길 수 있어요. 삶의 밸런스가 맞을 때 인생을 즐길 수 있는 것처럼...&quot; 
그리고 또 한 걸음. &#x27;나에겐 왜 이렇게 어려운 거지?&#x27;
삶은 누구에게나 쉽지 않은 것이죠. 하지만 주저앉지 않으면 언제나 헤쳐 나갈 길이 나타납니다.

팔을 계속 휘졌고 있었딱
이유는 너무 개설레잖아~?!
꺅~!!&gt;&lt;

동생 겁나 이기적이네
언니가 ATM기냐고:;:;
아빠랑 똑닮았네 개소름

강사님때문에 심장이 두근두근 나대는거야 
그리고 동생 뭐임?일단 말하는것부터 싸가지가 없는데 말하는 내용이??얘 인성에 문제있네 그리고 그걸 니가 왜 가지고 있니;;설마 혼자 운명이니 뭐니 생각하면서 망상에 빠져있는건 아니겠지?일단 그거 자기 언니건지는 아나?알면서도 자기가 계속 가지고있는거면 진짜 별로다;;;
강사님 얼굴 빨개진거봐!!!❤😭흉터 느낌이 났다는거..흉터가 저런 모양일 수 있나?아님..흉터를 가리기 위해서 타투같은걸 한건가...?

간혹 스태프 중에서도 사생나오는 경우 있던데...
스태프라도 그 연예인을 다 좋아하는건 아니라지만
걍 사생은 범죄예요 하지마세요 쫌;

저 커플은 옆에 지나가는 사람 부모 욕하는건 알고 있나..;
진짜 개극혐이네;;
(옆에 없다해서 욕해도 되는건 아니지만...)
장애인도 사람입니다.
사람은 인권이 있고요.
장애인이랍시고 무시하지 마세요;
